import React from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

const resultsData = [
  {
    courseCode: 'CSC 1101',
    courseTitle: 'Essential Hardware and Software Concepts',
    mark: '84',
    creditUnits: '4',
    grade: '5'
  },
  {
    courseCode: 'CSC 1102',
    courseTitle: 'Fundamentals of Computing',
    mark: '74',
    creditUnits: '4',
    grade: '4'
  },
  {
    courseCode: 'CSC 1103',
    courseTitle: 'Structured Programming',
    mark: '82',
    creditUnits: '4',
    grade: '5'
  },
  {
    courseCode: 'MAT 1101',
    courseTitle: 'Discrete Mathematics',
    mark: '81',
    creditUnits: '3',
    grade: '5'
  },
  {
    courseCode: 'ENG 1101',
    courseTitle: 'Writing and Study Skills',
    mark: '86',
    creditUnits: '3',
    grade: '5'
  },
  {
    courseCode: 'BIB 1101',
    courseTitle: 'Understanding the Old Testament',
    mark: '88',
    creditUnits: '3',
    grade: '5'
  }
];

const Education = () => {
  React.useEffect(() => {
    AOS.init({
      duration: 1000,
      once: true
    });
  }, []);

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <section id="education" className="education-section">
      <div className="education-container" data-aos="fade-up" data-aos-duration="1500">
        <h2>Year 1 Semester 1 Results</h2>
        <div className="table-wrapper">
          <table>
            <thead>
              <tr>
                <th>Course Code</th>
                <th>Course Title</th>
                <th>Mark</th>
                <th>Credit Units</th>
                <th>Grade</th>
              </tr>
            </thead>
            <tbody>
              {resultsData.map((result, index) => (
                <tr key={index}>
                  <td>{result.courseCode}</td>
                  <td>{result.courseTitle}</td>
                  <td>{result.mark}</td>
                  <td>{result.creditUnits}</td>
                  <td>{result.grade}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <div className="back-btn-container">
          <button className="back-btn" onClick={scrollToTop}>Back to Top</button>
        </div>
      </div>
    </section>
  );
};

export default Education;
